import React from "react";

export const useOnKeyUp = () => {
  const OnKey = (eventName, e) => {
    var value = e.target.value;
    console.log("event : " + eventName + ", value : " + value);
  };
  return (
    <>
      onkeyUp :
      <input type="text" onKeyUp={(e) => this.Onkey("onkeyUp", e)}></input>
    </>
  );
};
